import React from 'react'
import './css/card.css'
import Button from '@mui/material/Button';
export const Card = (props) => {
  return (
    <div className='card'>
        <div className='cardimg' style={{'background-image':'url(`{props.url})'}}></div>
        <div className='cardtitle'><span className='highlight'>{props.title}</span></div>
        <div className='cardcontent'>My personal blog page build with Next.js and Tailwind Css which takes the content from makdown files and renders it using Next.js. Supports dark mode and easy to write blogs using markdown.</div>
        <div className='cardbtn'>
        <Button variant="contained" style={{'background-color':'#C770F0',}}>Github</Button>
        </div>
    </div>
  )
}
